P.S.
If you are having the &quot;Insert Disk&quot; error do the following:
a) Using 7-zip or WinRAR to extract the .iso file and run the setup.exe from the extracted files
b) Mount the .iso file using Deamon Tools, and then copy all the files to a folder on your hard drive. Then run the setup.exe from there.

Both these solutions do the same thing - they copy all the files to your hard drive, where you then run the &quot;setup.exe&quot; file which installs this app.
Look in the crack folder for installation / activation guide.
